import React from 'react';

const Pagination = ({gotoNextPage, gotoPrevPage}) => {
    return(
        <div>
            <button onClick={gotoPrevPage}>
                Previous Page
            </button>
            <button onClick={gotoNextPage}>
                Next Page
            </button>
        </div>
    )
}

export default Pagination;
